import React, {Component} from 'react';
import Item from './Item';
import {Comsumer} from "../context";

class Items extends Component {
    render() {
        return (
            <Comsumer>
                {value => {
                    return value.items.map((item) => (
                        <Item key={item.id} item={item}/>
                    ));
                }}
            </Comsumer>
        );


    }
}

export default Items;
